export function getUserConsentCategories(consentCategories) {
  const activeGroups = consentCategories || window.OnetrustActiveGroups;
  if (activeGroups) {
    // Order OneTrust's user consent string ",C0002,C0001,C0003,"
    return activeGroups
      .split(",")
      .filter((x) => x)
      .sort()
      .join(",");
  }
  return "";
}
